<p>There you can find different calculators you may need</p>
<ul>
  <li>
    <a [routerLink]="['/cap-calc']">Capital calc</a>
  </li>
  <li>
    <a [routerLink]="['/alloy-calc']">Alloy calc</a>
  </li>  
</ul>
